import React, { Fragment } from "react";
import { useParams } from "react-router-dom";

const QuoteDetail = () => {
  const params = useParams();
  const { quoteId } = params;

  return (
    <Fragment>
      <h1>QuoteDetail Page</h1>
      <p>{quoteId}</p>
    </Fragment>
  );
};

export default QuoteDetail;
